import Link from "next/link";

const linkStyle = {
  marginRight: 15
}

const Header = () => (
  <header>
    <nav>
      <Link href="/"><a style={linkStyle}>Home</a></Link>
      <Link href="/about"><a style={linkStyle}>About</a></Link>
      <Link href="/movie"><a style={linkStyle}>Movies</a></Link>
    </nav>
  </header>
);

export default Header;
